import { Container, Button } from "react-bootstrap";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <Container className="text-center mt-5">
      <h1>Welcome to Our Healthcare System</h1>
      <p>Providing real-time patient health monitoring.</p>
      <div className="mt-4">
        <Link to="/login">
          <Button variant="primary" className="m-2">Login</Button>
        </Link>
        <Link to="/signup">
          <Button variant="success" className="m-2">Sign Up</Button>
        </Link>
      </div>
    </Container>
  );
};

export default Home;
